import { React, Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from "react-bootstrap/Form";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";

import { BrowserRouter, Route, Routes, Link, Outlet } from "react-router-dom";
import "./my_css.css";
import { Dropdown, DropdownButton } from "react-bootstrap";
// import images from "./images/81.jpeg";

function Landpg() {
  return (
    <Navbar bg="light" expand="lg">
      <Container fluid>
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: "100px" }}
            navbarScroll
          >
           <ul class="navbar-nav">
            <li class="nav-item">
              <img src={images} alt="My Image" style={{height:"56px",width:"8rem"}}/>
            </li></ul>
            <Nav.Link href="#action1" id="nav">
              Home
            </Nav.Link>
            <Nav.Link href="#action2" id="nav">
              About
            </Nav.Link>
            <Nav.Link href="#action2" id="nav">
              Contact Us
            </Nav.Link>
            <Nav.Link href="#action2" id="train">
              TRAIN
            </Nav.Link>
            <Nav.Link href="#action2" id="nav">
              Registration
            </Nav.Link>

            <Button variant="outline-success" id="login">
              Log In
            </Button>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button id="search">Search</Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
export default Landpg;
